import { useState } from "react";
import { useNavigate, useSearchParams } from "react-router-dom";

const Community = () => {
  const navigate = useNavigate();
  return (
    <div>
      <div>여기는 커뮤니티 생성 페이지 입니다.</div>
      <div>
        <h4>커뮤니티 리스트</h4>
      </div>
      <button
        onClick={() => {
          alert("로그인 성공");
          navigate("/community_create");
        }}
      >
        커뮤니티 생성하기
      </button>
    </div>
  );
};

export default Community;
